import { BrowserRouter as Router } from 'react-router-dom';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import AppRoutes from './router/AppRoutes';
import Home from './pages/Home';

function App() {
  return (
    <Router>
      <Navbar />
      <Home/>
      <Footer />
    </Router>
  );
}

export default App;
